                    <p>Our 2mm");
            WriteLiteral(@" wide shredded paper enhances products, strengthens brand identity and protects products in transit. Available in many colours. Colours can be mixed to match corporate colours. Our popular natural shade is made from British recycled paper and we can manufacture shred from the waste of disposable drink cup production.</p>
